import axios from "axios";

const fetchData = () => {
  axios
    .get("http://localhost:8080/api/tasks")
    .then((res) => {
      let copy = [...res.data];
      setTasks(copy);
    })
    .catch((err) => {
      console.log(err);
    });
};
